అమండా రే బార్డ్ (-బ్రౌన్) స్విమ్మింగ్ లో పాల్గొనే  [https://te.wikipedia.org/wiki/యునైటెడ్_స్టేట్స్ యునైటెడ్ స్టేట్స్][USA] దేశం కి చెందిన [https://te.wikipedia.org/wiki/ఒలింపిక్_క్రీడలు ఒలింపిక్] అథ్లెట్.

=వ్యక్తిగత జీవితము=
ఈ క్రీడాకారిణి జాతీయత యునైటెడ్ స్టేట్స్.

=క్రీడా జీవితం=
అమండా రే బార్డ్ (-బ్రౌన్) ఎత్తు 173.0 మీటర్లు.
అమండా రే బార్డ్ (-బ్రౌన్) బరువు 59.0 కిలోలు.
=== [https://te.wikipedia.org/wiki/1996_వేసవి_ఒలింపిక్_క్రీడలు 1996 ఒలింపిక్స్] ===
అమండా రే బార్డ్ (-బ్రౌన్) 1996 [https://te.wikipedia.org/wikiఅట్లాంటా అట్లాంటా] నగరంలో నిర్వహించబడిన సమ్మర్ ఒలింపిక్స్లో స్విమ్మింగ్ డిసిప్లిన్ లో స్విమ్మింగ్ ఉమెన్స్ 100 మీటర్స్ బ్రెస్ట్ స్ట్రోక్, స్విమ్మింగ్ ఉమెన్స్ 200 మీటర్స్ బ్రెస్ట్ స్ట్రోక్, స్విమ్మింగ్ ఉమెన్స్ 4 x 100 మీటర్స్ మెడ్లీ రిలే ఈవెంట్లలో పాల్గొనగా , స్విమ్మింగ్ ఉమెన్స్ 100 మీటర్స్ బ్రెస్ట్ స్ట్రోక్ లో సిల్వర్ [https://te.wikipedia.org/wiki/పతకం పతకం], స్విమ్మింగ్ ఉమెన్స్ 200 మీటర్స్ బ్రెస్ట్ స్ట్రోక్ లో సిల్వర్ [https://te.wikipedia.org/wiki/పతకం పతకం], స్విమ్మింగ్ ఉమెన్స్ 4 x 100 మీటర్స్ మెడ్లీ రిలే లో గోల్డ్ [https://te.wikipedia.org/wiki/పతకం పతకం] గెలుచుకుంది.
=== [https://te.wikipedia.org/wiki/2000_వేసవి_ఒలింపిక్_క్రీడలు 2000 ఒలింపిక్స్] ===
అమండా రే బార్డ్ (-బ్రౌన్) 2000 [https://te.wikipedia.org/wikiసిడ్నీ సిడ్నీ] నగరంలో నిర్వహించబడిన సమ్మర్ ఒలింపిక్స్లో స్విమ్మింగ్ డిసిప్లిన్ లో స్విమ్మింగ్ ఉమెన్స్ 200 మీటర్స్ బ్రెస్ట్ స్ట్రోక్ ఈవెంట్లో పాల్గొనగా , స్విమ్మింగ్ ఉమెన్స్ 200 మీటర్స్ బ్రెస్ట్ స్ట్రోక్ లో బ్రోన్జ్ [https://te.wikipedia.org/wiki/పతకం పతకం] గెలుచుకుంది.
=== [https://te.wikipedia.org/wiki/2004_వేసవి_ఒలింపిక్_క్రీడలు 2004 ఒలింపిక్స్] ===
[https://te.wikipedia.org/wikiఅథిన అథిన] నగరంలో నిర్వహించబడిన 2004 సమ్మర్ ఒలింపిక్స్లో అమండా రే బార్డ్ (-బ్రౌన్) స్విమ్మింగ్ డిసిప్లిన్ లో స్విమ్మింగ్ ఉమెన్స్ 100 మీటర్స్ బ్రెస్ట్ స్ట్రోక్, స్విమ్మింగ్ ఉమెన్స్ 200 మీటర్స్ బ్రెస్ట్ స్ట్రోక్, స్విమ్మింగ్ ఉమెన్స్ 200 మీటర్స్ ఇండివిడ్యువల్ మెడ్లీ, స్విమ్మింగ్ ఉమెన్స్ 4 x 100 మీటర్స్ మెడ్లీ రిలే ఈవెంట్లలో పాల్గొనగా , స్విమ్మింగ్ ఉమెన్స్ 200 మీటర్స్ బ్రెస్ట్ స్ట్రోక్ లో గోల్డ్ [https://te.wikipedia.org/wiki/పతకం పతకం], స్విమ్మింగ్ ఉమెన్స్ 200 మీటర్స్ ఇండివిడ్యువల్ మెడ్లీ లో సిల్వర్ [https://te.wikipedia.org/wiki/పతకం పతకం], స్విమ్మింగ్ ఉమెన్స్ 4 x 100 మీటర్స్ మెడ్లీ రిలే లో సిల్వర్ [https://te.wikipedia.org/wiki/పతకం పతకం] గెలుచుకుంది.
=== [https://te.wikipedia.org/wiki/2008_వేసవి_ఒలింపిక్_క్రీడలు 2008 ఒలింపిక్స్] ===
[https://te.wikipedia.org/wikiబీజింగ్ బీజింగ్] నగరంలో నిర్వహించబడిన 2008 సమ్మర్ ఒలింపిక్స్లో అమండా రే బార్డ్ (-బ్రౌన్) స్విమ్మింగ్ డిసిప్లిన్ లో స్విమ్మింగ్ ఉమెన్స్ 200 మీటర్స్ బ్రెస్ట్ స్ట్రోక్ ఈవెంట్లో పాల్గొనగా [https://te.wikipedia.org/wiki/పతకం పతకం] గెల్వకుండానే వెనుతిరిగింది.


